(232, 3, '2013-04-29 12:15:42', '2013-04-29 12:15:42', '[embed]http://vimeo.com/25833596[/embed]\r\n[lead]Our new trailer was released today![/lead]\r\n<p>Boy the way Glen Miller played, songs that made the hit parade. Guys like us we had it made, those were the days. And you knew who you were then, girls were girls and men were men. Mister, we could use a man like Herbert Hoover again. Didn\'t need no welfare state, everybody pulled his weight. Gee our old LaSalle ran great. Those were the days.</p>\r\n\r\n\r\n[row]\r\n[app_store link="#" open_in="_parent"] [google_play package="#" style="android-app" open_in="_parent" ]\r\n[/row]\r\n\r\n[span11]\r\n[social icon_1="icon-facebook" url_1="#" icon_2="icon-twitter" url_2="#" icon_3="icon-google-plus" url_3="#"]\r\n[/span11]', 'Latest Trailer', '', 'publish', 'open', 'open', '', 'latest-trailer', '', '', '2015-11-19 18:20:42', '2015-11-19 18:20:42', '', 0, 'http://themes.oxygenna.com/appland/?p=232', 0, 'post', '', 1),
